import { useState } from "react";


function App(){
    const [data,setData]=useState([])
    fetch("  http://localhost:3009/project")
    .then((res)=>{
        return res.json()
    })
    .then((resp)=>{
        setData(resp)
    },[])
    return(
        <div>
             <div className="card">
                <div>
                   {data.map((ourdata)=>(
                      <div>
                        <img src={ourdata.img} style={{width:"200px", height:"200px"}}/>
                        <h3>{ourdata.name}</h3>
                        <p>{ourdata.manufacturer}</p>
                        <p>{ourdata.production}</p>
                        <p>{ourdata.price}</p>
                        <button className="btn  btn-primary" >BUY THIS</button>
                      </div>
                   ))}
                </div>

             </div>
        </div>
    )
}
export default App;
